gnw(){return"DETO is a free appointment calendar app for all kinds of democratic events.\n\nDeto has been conceived and developed for you and should be a useful tool for you to be able to express your political and democratic wishes. We hope that we can contribute a small part to this with our app.\n\nThe realization and realization of the deto app is a community effort and it would never have been completed without the help of a special person. Therefore, our special thanks go to Roi Peker, who developed the entire technical backend during the entire development and implemented it very competently, as well as always giving us a very helping hand in many other points. We would therefore be very happy if you would support this person, so please take a look at the developer thanks dialog, which you can find a little further down. Click once on the field to enlarge it and then on the button inside.\n\nMany thanks to all the smaller deto helpers, in the near future as well as in the past.\n\n-\n\n-\n\n-\n\nSpecial greetings to:\n\n- Roi Peker (Tech Mage)\n\nWe are always open to suggestions for improvement, if you have any questions or anything else you can either use the contact form or simply join our Telegram group or visit the Deto Telegram channel.\n\nWe wish you every success with your events and we hope you have a lot of fun with your Deto app.\n\nThanks again to Roi Peker, stay the way you are, a great person...."},
