gnw(){return"Deto es una aplicaci\xf3n de calendario de citas gratuita para todo tipo de eventos democr\xe1ticos.\n\nDeto ha sido concebido y desarrollado para usted y deber\xeda ser una herramienta \xfatil para que pueda expresar sus deseos pol\xedticos y democr\xe1ticos. Esperamos poder contribuir con una peque\xf1a parte a esto con nuestra aplicaci\xf3n.\n\nLa realizaci\xf3n y realizaci\xf3n de la aplicaci\xf3n DETO es un esfuerzo comunitario y nunca se habr\xeda completado sin la ayuda de una persona especial. Por lo tanto, nuestro agradecimiento especial a Roi Peker, quien desarroll\xf3 todo el backend t\xe9cnico durante todo el desarrollo y lo implement\xf3 de manera muy competente, y siempre nos dio una mano muy amiga en muchos otros puntos. Por lo tanto, estar\xedamos muy contentos si apoya a esta persona, as\xed que eche un vistazo al di\xe1logo de agradecimiento del desarrollador, que puede encontrar un poco m\xe1s abajo. Haga clic una vez en el campo para ampliarlo y luego en el bot\xf3n dentro.\n\nMuchas gracias a todos los ayudantes de Deto m\xe1s peque\xf1os, en el futuro cercano, as\xed como en el pasado.\n\n-\n\n-\n\n-\n\nSaludos especiales a:\n\n- Roi Peker (Tech Mage)\n\nSiempre estamos abiertos a sugerencias de mejora, si tiene alguna pregunta o cualquier otra cosa, puede usar el formulario de contacto o simplemente unirse a nuestro grupo Telegram o visitar el canal Deto Telegram.\n\nLe deseamos todo el \xe9xito con sus eventos y esperamos que se divierta mucho con su aplicaci\xf3n DETO.\n\nGracias de nuevo a Roi Peker, mantente como eres, una gran persona ..."},
